import FontAwesome from "@./components/FontAwesome";
import Header from "./components/Header";
import General from "./components/General";
import Educational from "./components/Educational";

function App() {
  return (
    <div className='flex'>
      <Header />
      <div className='container'>
        <General />
        <Educational />
      </div>
    </div>
  );
}

export default App;
